  @override
  Future<void> vacancyApply({
    String? vacancyId,
    String? email,
    String? surname,
    String? phone,
    String? text,
    File? cv,
    File? motif,
  }) async {
    final _extra = <String, dynamic>{};
    final queryParameters = <String, dynamic>{};
    queryParameters.removeWhere((k, v) => v == null);
    final _headers = <String, dynamic>{};
    final _data = FormData();
    if (vacancyId != null) {
      _data.fields.add(MapEntry(
        'vacancyId',
        vacancyId,
      ));
    }
    if (email != null) {
      _data.fields.add(MapEntry(
        'email',
        email,
      ));
    }
    if (surname != null) {
      _data.fields.add(MapEntry(
        'surname',
        surname,
      ));
    }
    if (phone != null) {
      _data.fields.add(MapEntry(
        'phone',
        phone,
      ));
    }
    if (text != null) {
      _data.fields.add(MapEntry(
        'text',
        text,
      ));
    }
    if (cv != null) {
      if (cv != null) {
        _data.files.add(MapEntry(
          'file',
          MultipartFile.fromFileSync(
            cv.path,
            filename: cv.path.split(Platform.pathSeparator).last,
          ),
        ));
      }
    }
    if (motif != null) {
      if (motif != null) {
        _data.files.add(MapEntry(
          'files[]',
          MultipartFile.fromFileSync(
            motif.path,
            filename: motif.path.split(Platform.pathSeparator).last,
          ),
        ));
      }
    }
    final _options = _setStreamType<void>(Options(
      method: 'POST',
      headers: _headers,
      extra: _extra,
    )
        .compose(
          _dio.options,
          '/api/apply',
          queryParameters: queryParameters,
          data: _data,
        )
        .copyWith(
            baseUrl: _combineBaseUrls(
          _dio.options.baseUrl,
          baseUrl,
        )));
    await _dio.fetch<void>(_options);
  }

